import React from 'react';
import Skills from './Skills';
import Testimonials from './Testimonials';
import Game from './game';


const WhyChoosem = () => {
  return (
    <main className="text-dark-400 bg-dark-900 body-font">
      <Skills />
      <Testimonials />
      <Game />
    </main>
  );
};

export default WhyChoosem;
